  true,\n\t\"url\": null,\n\t\"notes\": \"The Federal School Code List contains the
  unique codes assigned by the Department of Education for schools participating in
  the Title IV federal student aid programs. Students can enter these codes on the
  Free Application for Federal Student Aid (FAFSA) to indicate which postsecondary
  schools they want to receive their financial application results. The Federal School
  Code List is a searchable document in PDF and Excel format. The list will be updated
  on the first of February, May, August, and November of each calendar year.\",\n\t\"license_title\":
